import React from "react";

const Header = () => {
  return (
    <Box bgcolor="#000000" color="#ffffff" sx={{ p: 3 }}>
  <div className="ui fixed menu">
    <div className="ui container center">
      <h2>Hotels</h2>
    </div>
  </div>
  </Box>
  );
};

export default Header;
